import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 8.01-66.10 Death claims settled by compromise or suit.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-66.10.md","filePath":"vacode/8.01-66.10.md"}'),s={name:"vacode/8.01-66.10.md"},o=r('<h1 id="§-8-01-66-10-death-claims-settled-by-compromise-or-suit" tabindex="-1">§ 8.01-66.10 Death claims settled by compromise or suit. <a class="header-anchor" href="#§-8-01-66-10-death-claims-settled-by-compromise-or-suit" aria-label="Permalink to &quot;§ 8.01-66.10 Death claims settled by compromise or suit.&quot;">​</a></h1><p>In case of personal injuries resulting in death and settlement therefor by compromise or suit under the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/8.01-50/" target="_blank" rel="noreferrer">8.01-50</a> to <a href="http://law.lis.virginia.gov/vacode/8.01-56/" target="_blank" rel="noreferrer">8.01-56</a>, the liens provided for in this article may be asserted against the recovery, or against the estate of the decedent, but not both. If asserted against the recovery and paid, such liens shall attach pro rata to the amounts received respectively by such beneficiaries as are designated to receive the moneys distributed and in their respective amounts; and such beneficiaries, or the personal representative for their benefit, shall be subrogated to the liens against the estate of such decedent provided for by § <a href="http://law.lis.virginia.gov/vacode/64.2-528/" target="_blank" rel="noreferrer">64.2-528</a>.</p><p>Code 1950, § 32-141; 1979, c. 722.</p>',3),i=[o];function n(c,d,l,h,p,_){return t(),a("div",null,i)}const u=e(s,[["render",n]]);export{f as __pageData,u as default};
